function Home(){
    return(
        <>
            <div className="bPage" >
                <img src={path} className={'bPage-img'} alt="..."/>
                <div className="bPage-Text">
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk
                        of the card's content.</p>
                </div>
            </div>
        </>
    );
}

export default Home;
